  constructor(props) {
    super(props);
    this.state = {
      username: "",
      password: "",
    };
    console.log("다운로드 테스트.");
  }

  //유저 로그인 상태 체크
  componentDidMount() {

  }

  DLTest(){
    console.log("다운 테스트.");
  }
  render() {
    console.log('download button render.');
    return (
      <Fragment>
            <DownloadTestForm
                downloadTest={self.DLTest}
            />
      </Fragment>
    );
  }
}
